void RegisterFlagsTable(lua_State *L, FlagEntry* entry, size_t count) {
    for (int i = 0; i < count; i++) {
        lua_pushnumber(L, entry[i].value);
        lua_setglobal(L, entry[i].name);
    }
}


#define arrayLen(array) sizeof(array) / sizeof(array[0])
void registerFlags(lua_State* L) {
    RegisterFlagsTable(L, LuaGuiDataType, arrayLen(LuaGuiDataType));
    RegisterFlagsTable(L, LuaGuiDir, arrayLen(LuaGuiDir));
    RegisterFlagsTable(L, LuaGuiSortDirection, arrayLen(LuaGuiSortDirection));
    RegisterFlagsTable(L, LuaGuiKey, arrayLen(LuaGuiKey));
    RegisterFlagsTable(L, LuaGuiInputFlags, arrayLen(LuaGuiInputFlags));
    RegisterFlagsTable(L, LuaGuiConfigFlags, arrayLen(LuaGuiConfigFlags));
    RegisterFlagsTable(L, LuaGuiBackendFlags, arrayLen(LuaGuiBackendFlags));
    RegisterFlagsTable(L, LuaGuiCol, arrayLen(LuaGuiCol));
    RegisterFlagsTable(L, LuaGuiStyleVar, arrayLen(LuaGuiStyleVar));
    RegisterFlagsTable(L, LuaGuiButtonFlags, arrayLen(LuaGuiButtonFlags));
    RegisterFlagsTable(L, LuaGuiColorEditFlags, arrayLen(LuaGuiColorEditFlags));
    RegisterFlagsTable(L, LuaGuiSliderFlags, arrayLen(LuaGuiSliderFlags));
    RegisterFlagsTable(L, LuaGuiMouseButton, arrayLen(LuaGuiMouseButton));
    RegisterFlagsTable(L, LuaGuiMouseCursor, arrayLen(LuaGuiMouseCursor));
    RegisterFlagsTable(L, LuaGuiMouseSource, arrayLen(LuaGuiMouseSource));
    RegisterFlagsTable(L, LuaGuiCond, arrayLen(LuaGuiCond));
    RegisterFlagsTable(L, LuaGuiTableFlags, arrayLen(LuaGuiTableFlags));
    RegisterFlagsTable(L, LuaGuiTableColumnFlags, arrayLen(LuaGuiTableColumnFlags));
    RegisterFlagsTable(L, LuaGuiTableRowFlags, arrayLen(LuaGuiTableRowFlags));
    RegisterFlagsTable(L, LuaGuiTableBgTarget, arrayLen(LuaGuiTableBgTarget));
    RegisterFlagsTable(L, LuaGuiDragDropFlags, arrayLen(LuaGuiDragDropFlags));

}

